    "Non-Toxic HAN Monopropellant Propulsion Project",nt"tracking_summary": {ntt"total":
    15,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T20:45:10.703231",nt"name": "non-toxic-han-monopropellant-propulsion-project-593b2",nt"isopen":
    true,nt"url": null,nt"notes": "Non-toxic monopropellants have been developed
    that provide better performance than toxic hydrazine. Formulations based on hydroxylammonium
    nitrate (HAN) have superior performance as compared to hydrazine with Isp (261 seconds,
    12&#37; greater), higher density and volumetric impulse, lower melting point, and
    much lower toxicity (No self contained breathing apparatus required). HAN based
    monopropellants require higher chamber temperatures (2083K vs 883K) to combust.
    Current hydrazine based combustion chamber technology (Inconel or niobium C103 and
    silicide coating) and catalyst (Shell 405) are inadequate. However, current state
    of the art iridium lined rhenium chambers are compatible with monopropellants and
    new ignition techniques are being developed. The goal of the SBIR project is fabricate
    and test a flight weight thrust chamber for HAN based monopropellants. ",nt"license_title":
